import react from "react";
import styles from "../../index.module.scss";

function UsersList({ users }) {
  return (
    <div>
      <div>
        {users.map((user) => {
          return <div className={styles.userCard}>{user.name}</div>;
        })}
      </div>
    </div>
  );
}

export default UsersList;
